import React, { useEffect, useState } from 'react'
import axios from 'axios';

const Book = () => {
    const [book, setBook] = useState([]);
    useEffect(()=>{
        const fetchBookDAta = async()=>{
            try{
                const res = await axios.get('http://localhost:8821/books')
                console.log(res)
            }
            catch(err){
                console.log(err)
            }
        }
    },[])
  return (
    <div>Book</div>
  )
}

export default Book
